import React, { useState } from "react";
import { ButtonGroup, Button, Slider } from "@mui/material";

const SliderValsBook = {
  defaultValue: 1,
  step: 1,
  marks,
  min: 1,
  max: 23,
};

const SliderValsTime = {
  defaultValue,
};

const Changer = () => {
  const [isTimeSelected, setTimeSelected] = useState(true);
  const [isBookSelected, setBookSelected] = useState(false);

  return (
    <div className='flex flex-col '>
      <ButtonGroup variant='contained'>
        <Button> Chronological </Button>
        <Button> Book </Button>
      </ButtonGroup>

      <Slider />
    </div>
  );
};

export default Changer;
